from myBasics import base64ToBin  # pip install myBasics
import hashlib


def _hash_sha256(data, upper: bool = False) -> str:
    if (type(data) == type('')):
        data = data.encode('utf-8')
    if upper:
        return hashlib.sha256(data).hexdigest().upper()
    return hashlib.sha256(data).hexdigest()


